{% block title %}Coach index{% endblock %}

{% block body %}
    <h1>Coach index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>FirstName</th>
                <th>SecondName</th>
                <th>Email</th>
                <th>Password</th>
                <th>RegistrationDate</th>
                <th>BirthDate</th>
                <th>TeachingDomain</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for coach in coaches %}
            <tr>
                <td>{{ coach.id }}</td>
                <td>{{ coach.firstName }}</td>
                <td>{{ coach.secondName }}</td>
                <td>{{ coach.email }}</td>
                <td>{{ coach.password }}</td>
                <td>{{ coach.registrationDate ? coach.registrationDate|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ coach.birthDate ? coach.birthDate|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ coach.teachingDomain ? coach.teachingDomain|join(', ') : '' }}</td>
                <td>
                    <a href=\"{{ path('app_coach_show', {'id': coach.id}) }}\">show</a>
                    <a href=\"{{ path('app_coach_edit', {'id': coach.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"9\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_coach_new') }}\">Create new</a>
{% endblock %}
